import styled from 'styled-components';

export const MapMarkerStyle = styled.div`
  background-color: blue;
  width: 1rem;
  height: 1rem;
  display: block;
  left: -0.5rem;
  top: -0.5rem;
  position: relative;
  color: #ffffff;
  font-size: 0.6rem;
  border-radius: 1.5rem 1.5rem 0;
  transform: rotate(45deg);
  border: 1px solid #FFFFFF;
`;
